<div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x1 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0"><?php echo $_GET['type']; ?><span class="_"> </span><span class="fs1 fc1 ws1 v1">Date:<span class="ff2 fc2 ws5"> <?php echo $_GET['date']; ?></span></span></div><div class="t m0 x1 h3 y2 ff2 fs2 fc3 sc0 ls0 ws5"><?php echo $_GET['sub_text']; ?></div><div class="t m0 x2 h4 y3 ff1 fs3 fc3 sc0 ls0 ws2">Address<span class="_"> </span><span class="ff2 ws5"><?php echo $_GET['address']; ?></span></div><div class="t m0 x2 h4 y4 ff1 fs3 fc3 sc0 ls0 ws3">Zone<span class="_"> </span><span class="ff2 ws5"><?php echo $_GET['zone']; ?></span></div><div class="t m0 x2 h4 y5 ff1 fs3 fc3 sc0 ls0 ws4">Council<span class="_"> </span><span class="ff2 ws5"><?php echo $_GET['council']; ?></span></div><div class="t m0 x2 h4 y6 ff1 fs3 fc3 sc0 ls0 ws5">Lot/Section/Plan No.<span class="_ _0"> </span><span class="ff2"><?php echo $_GET['lot']; ?></span></div><div class="t m0 x2 h4 y7 ff1 fs3 fc3 sc0 ls0 ws5">Property Size<span class="_ _1"> </span><span class="ff2"><?php echo $_GET['size']; ?> m<sup>2<sup></span></div><div class="t m0 x1 h5 y8 ff1 fs4 fc0 sc0 ls0">Summary</div><div class="t m0 x1 h5 y9 ff1 fs4 fc0 sc0 ls0 ws5">Of Affects</div><div class="t m0 x1 h6 ya ff1 fs0 fc0 sc0 ls0 ws5">PROPOSED STRUCTURE</div><div class="t m0 x1 h3 yb ff2 fs2 fc3 sc0 ls0 ws5">Class 10a Shed</div><div class="t m0 x1 h3 yc ff2 fs2 fc3 sc0 ls0 ws5">Ancillary Structure</div><div class="t m0 x1 h3 yd ff2 fs2 fc3 sc0 ls0">Rural/Residential</div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x1 h6 ye ff1 fs0 fc0 sc0 ls0 ws5">APPROVAL PATHWAYS</div><div class="t m0 x1 h7 yf ff2 fs1 fc3 sc0 ls0 ws5">So, you want your <span class="ff1 ws1">Deck</span> approved, there are multiple approval pathways to</div><div class="t m0 x1 h7 y10 ff2 fs1 fc3 sc0 ls0">consider;</div><div class="t m0 x1 h4 y11 ff1 fs3 fc3 sc0 ls0 ws5">1. Exempt Development:<span class="ff2"> An ‘Approval’ pathway which avoids an approving authority, to</span></div><div class="t m0 x1 h4 y12 ff2 fs3 fc3 sc0 ls0 ws5">have an exempt development you will need to meet all exempt planning guidelines as</div><div class="t m0 x1 h4 y13 ff2 fs3 fc3 sc0 ls0 ws5">outlined under the State Environmental Planning Policy (Exempt and Complying</div><div class="t m0 x1 h4 y14 ff2 fs3 fc3 sc0 ls0 ws5">Development Codes) 2008 (‘SEPP’). Note: ED must be declared to council.</div><div class="t m0 x1 h4 y15 ff1 fs3 fc3 sc0 ls0 ws5">2. Complying Development Certificate (‘CDC Approval’):<span class="ff2"> Complying Development</span></div><div class="t m0 x1 h4 y16 ff2 fs3 fc3 sc0 ls0 ws5">Approval is provided by a private certifier or council under the SEPP. These guidelines are</div><div class="t m0 x1 h4 y17 ff2 fs3 fc3 sc0 ls0 ws5">more flexible than the exempt guidelines under the SEPP, however all must be met as well.</div><div class="t m0 x1 h4 y18 ff2 fs3 fc3 sc0 ls0 ws5">The CDC pathway is generally completed under a private certifier and is considered the faster</div><div class="t m0 x1 h4 y19 ff2 fs3 fc3 sc0 ls0 ws5">approval pathway compared to council.</div><div class="t m0 x1 h4 y1a ff1 fs3 fc3 sc0 ls0 ws5">3. Council Approval - Development Application (‘DA’) and Construction Certificate</div><div class="t m0 x1 h4 y1b ff1 fs3 fc3 sc0 ls0 ws6">(‘CC’):<span class="ff2 ws5"> This pathway allows for the greatest variation of guidelines to meet your site. The</span></div><div class="t m0 x1 h4 y1c ff2 fs3 fc3 sc0 ls0 ws5">guidelines for Council Approval or DA/CC approval are found within the council Development</div><div class="t m0 x1 h4 y1d ff2 fs3 fc3 sc0 ls0 ws5">Control Plan. Depending on the council you are located in, you may have flexibility for merit-</div><div class="t m0 x1 h4 y1e ff2 fs3 fc3 sc0 ls0 ws5">based assessment and variation to these guidelines.</div><div class="t m0 x1 h6 y1f ff1 fs0 fc0 sc0 ls0 ws5">APPROVAL PATHWAY OPTIONS</div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
