<div id="pf8" class="pf w0 h0" data-page-no="8"><div class="pc pc8 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="t m0 x1 h3 y20 ff1 fs2 fc0 sc0 ls0 ws5">SITE HAZARDS AND ENVIRONMENTAL CONSIDERATIONS</div><div class="t m0 x1 h3 y61 ff1 fs2 fc3 sc0 ls0 ws5">Bushfire Prone Land – Category XXX</div><div class="t m0 x1 h4 y62 ff4 fs3 fc3 sc0 ls0 ws5">What does it mean:</div><div class="t m0 x1 h4 y63 ff2 fs3 fc3 sc0 ls0 ws5">• The site is effected by Bushfire zoning, which means a BAL (Bushfire Attack Level) will be</div><div class="t m0 x1 h4 y64 ff2 fs3 fc3 sc0 ls0">determined.</div><div class="t m0 x1 h4 y65 ff2 fs3 fc3 sc0 ls0 ws5">• Additionally, you will need to adhere to fire rating requirements and specific setbacks to</div><div class="t m0 x1 h4 y66 ff2 fs3 fc3 sc0 ls0 ws5">existing structures.</div><div class="t m0 x1 h4 y67 ff4 fs3 fc3 sc0 ls0 ws5">Implication on your build:</div><div class="t m0 x1 h4 y68 ff2 fs3 fc3 sc0 ls0 ws5">The proposed structure will need to be setback a minimum of 6m from the existing dwelling. A</div><div class="t m0 x1 h4 y69 ff2 fs3 fc3 sc0 ls0 ws5">bushfire report may be required from a license Bushfire Consultant, or a bushfire self-</div><div class="t m0 x1 h4 y6a ff2 fs3 fc3 sc0 ls0 ws5">assessment may be requested: (<span class="fc5">https://www.rfs.nsw.gov.au/resources/publications/building-</span></div><div class="t m0 x1 h4 y6b ff2 fs3 fc5 sc0 ls0 ws6">in-a-bush-fire-area/general/single-dwellingapplication<span class="fc3 ws5">- kit)</span></div><div class="t m0 x1 h4 y6c ff4 fs3 fc3 sc0 ls0 ws5">How to manage:</div><div class="t m0 x1 h4 y6d ff2 fs3 fc3 sc0 ls0 ws5">• Build over 6m from the dwelling/existing structures on the site.</div><div class="t m0 x1 h4 y6e ff2 fs3 fc3 sc0 ls0 ws5">• Investigate fire rated materials that may be requested by council or a certifier.</div><div class="t m0 x1 h4 y6f ff2 fs3 fc3 sc0 ls0 ws5">• Investigate licenced bushfire consultants.</div><a class="l" href="https://www.rfs.nsw.gov.au/resources/publications/building-in-a-bush-fire-area/general/single-dwellingapplication"><div class="d m1" style="border-style:none;position:absolute;left:232.255900px;bottom:455.481300px;width:274.848000px;height:10.683700px;background-color:rgba(255,255,255,0.000001);"></div></a><a class="l" href="https://www.rfs.nsw.gov.au/resources/publications/building-in-a-bush-fire-area/general/single-dwellingapplication"><div class="d m1" style="border-style:none;position:absolute;left:79.942900px;bottom:442.660800px;width:246.246000px;height:10.683700px;background-color:rgba(255,255,255,0.000001);"></div></a></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
